import { Box, Typography, styled } from "@mui/material";


const Component = styled(Box)`
border-top: 1px solid #f0f0f0;
display: flex;
`;

const CartItem = ({ item }) => {
    return (
        <>
            <Box>
                <img src={item.url} alt="product" />
            </Box>
            <Box>
                <Typography>{item.title.longTitle}</Typography>
            </Box>
        </>
    )
}
export default CartItem;
